//-------------------------------------------------------------------------------

var Verilog = {};
Verilog.load = function() {

    ace.define('ace/snippets/verilog', ['require', 'exports', 'module' ], function(require, exports, module) {


        exports.snippetText = "";
        exports.scope = "verilog";

        });

};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Verilog', Verilog);